import React, { Component } from 'react'
// import ChatBubbleIcon from '@material-ui/icons/ChatBubble';
export default class CrdsImage extends Component {
    render() {
        return (
            <div>
                    <div className='card text-center'>
                           <div className='overflow'>
                                 <img src={this.props.imgsrc} alt='error' className='card-img-top'/>  
                           </div>
                           <div className='card-body text-dark mb-5'>
                                   <h4 className='card-title'>
                                       {this.props.title}
                                   </h4>
                                   <p className='card-text text-secondary'>
                                         {this.props.para} &nbsp;&nbsp;&nbsp;&nbsp;
                                         {/* <i class="fa fa-dollar"></i> */}
                                         {this.props.dollar}
                                         
                                   </p>
                                    <p className='mr-5'><i class="fa fa-shopping-cart shop "></i> &nbsp;Delivery Free : Free</p>
                                    <p className='mr-4 tim'><i class="fa fa-clock-o clock"></i>&nbsp;Delivery Time : 30 Min</p>
                                    <div className='row'>

                                    <span class="fa fa-star checked ml-4"></span>
                                    <span class="fa fa-star checked ml-2"></span>
                                    <span class="fa fa-star checked ml-2"></span>
                                    <span class="fa fa-star checked ml-2"></span>
                                    <span class="fa fa-star checked ml-2"></span>

                                    <i class='fas fa-comment-alt message'><span className='ml-2 mb-1 mes5'>05</span></i>
                                    </div>
                                   
                                    {/* <div>Icons made by <a href="https://www.flaticon.com/authors/pixel-buddha" title="Pixel Buddha">Pixel Buddha</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div> */}
                                    {/* <span class="flaticon-airplane49"></span> */}
                                    {/* <i class="flaticon-airplane49"></i> */}
                                    {/* <ChatBubbleIcon /> */}
                                   
                           </div>

                    </div>



                    
            </div>
        )
    }
}
